class EmptyClass {

public static void addShaped(RecipeDifficulty difficulty, ItemStack result, Object... recipe) {
        if (difficulty != ALL && RecipeDifficulty.getDifficulty() != difficulty) {
            return;
        }

        boolean isOre = false;

        if (!isEnabled(result)) {
            return;
        }

        for (int i = 3; i < recipe.length; i++) {
            if (recipe[i] instanceof String) {
                isOre = true;
            }

            if (!isEnabled(recipe[i])) {
                return;
            }
        }

        if (isOre) {
            ResourceLocation location = getNameForRecipe(result);
            ShapedOreRecipe shapedOreRecipe = new ShapedOreRecipe(location, result, recipe);
            shapedOreRecipe.setRegistryName(location);
            GameData.register_impl(shapedOreRecipe);
        }
        else {
            ResourceLocation location = getNameForRecipe(result);
            CraftingHelper.ShapedPrimer primer = CraftingHelper.parseShaped(recipe);
            ShapedRecipes shapedRecipes = new ShapedRecipes(result.getItem().getRegistryName().toString(), primer.width, primer.height, primer.input, result);
            shapedRecipes.setRegistryName(location);
            GameData.register_impl(shapedRecipes);
        }
    }
}

class EmptyClass {


	public static <P extends IUnlistedProperty<T>, T> T getStatePropertySafely(@Nullable TileEntity te, Class<? extends Block> block, P property, T defaultVal, boolean actual, boolean extended) {
		if(te == null || te.getWorld() == null) {
			return defaultVal;
		}
		IBlockState state = te.getWorld().getBlockState(te.getPos());
		if(block.isInstance(state.getBlock())) {
			if(actual) {
				state = state.getActualState(te.getWorld(), te.getPos());
			}
			if(extended) {
				state = state.getBlock().getExtendedState(state, te.getWorld(), te.getPos());
			}
			if(state instanceof IExtendedBlockState) {
				return ((IExtendedBlockState)state).getValue(property);
			}
		}
		return defaultVal;
	}
}

